	<h1 style="text-align:center">TinySoundFont HTML5 MIDI Player</h1>
	<div style="text-align:center;margin:20px">Made with <a href="https://github.com/schellingb/TinySoundFont">TinySoundFont</a>, <a href="https://github.com/schellingb/TinySoundFont">TinyMidiLoader</a> and <a href="https://github.com/schellingb/ZillaLib">ZillaLib Multimedia Framework</a>!</div>

{

	requestWidth: 960,
	requestHeight: 320,
	openUrl: function(url) { },

	{
		var L = function(id)
		{

		{

		}
	},
};
window.onerror = function(e,u,l){alert(e);};
function load_midi(field, contents)
{
	var isValid = false;
	if (!contents)
	{
		var file = (field && field.files && field.files.length > 0 ? field.files[0] : undefined)
		if (!file) return;
		var reader = new FileReader();
		reader.onloadend = function(evt) { load_midi(field, new Uint8Array(evt.target.result)); };
		reader.readAsArrayBuffer(file);
		return;
	}

	var ptr = _malloc(contents.length);
	for (i = 0; i < contents.length; ++i) HEAP8[ptr+i] = contents[i];
	_WMP_LoadMidi(ptr, contents.length);
	_free(ptr);
}
